import React from 'react';
import './style.css';

export default function TopBar() {
  return (
    <div className="topBarBody">
      <div>
        <p className="logo">Cookiy</p>
      </div>
      <div>
        <a href="App.js">Home</a>
        <a href="Favourite.js">Favourite</a>
      </div>
    </div>
  );
}
